    amended the description on Schedule H4 from Supplies to Office Supplies.  The
    unique identifying codes have been added and the event year-to-date calculations
    have been corrected.                As our staff informed you on a phone message,
    we are unable to find the description Inkind Contribution. We have had our programmer
